import React from 'react';
import { HashRouter , Route, Routes } from 'react-router-dom';
import routes from './index'

function Router() {
    return (
    <HashRouter >
        <Routes>
        { routes.map((prop, key) => {
            return (
            <Route
                path={prop.path}
                key={key}
                component={(props) => <prop.component    {...props} />}
                exact={prop.exact ? true : false}
            />);
        })}
        </Routes>
    </HashRouter>
    );
  }
  
export default Router;
